import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Card from './Card';
import sun from '../images/sun.png';
import rain from '../images/rain.png';

const currentWeather = {
  day: 'Monday',
  wheatherImage: sun,
  dayTemperature: '20℃',
  nightTemperature: '15℃'
}

const otherWeather = {
  day: 'Wednesday',
  wheatherImage: rain,
  dayTemperature: '15℃',
  nightTemperature: '9℃'
}

export default class App extends React.Component{
  render(){
    function Sun(){
      return <h2>Sunny!</h2>
    }
    function Rain(){
      return <h2>It's raining(</h2>
    }
    return (
      <Router>
        <div className='card-group'>
          <Card currentWeather={currentWeather} callback={Sun} />
          <Card currentWeather={otherWeather} callback={Rain} />
        </div>
        <Route path='/' exact component={this.props.callback} />
      </Router>
    )
  }
}
